import './styles.css';
import {Navbar} from "./components/Navbar";
import {ItemListContainer} from "./components/ItemListContainer/ItemListContainer"
import Counter from './components/Counter';

function App() {
  return (
    <div className="App">
    <Navbar/>
    <ItemListContainer/>
    <Counter/>
    </div>
  );
}
export default App;
